import { DefaultTheme } from "react-native-paper";

export const theme = {
  ...DefaultTheme,
  roundness: 2,
  colors: {
    ...DefaultTheme.colors,
    primary: "#091829",
    accent: "#b8b5ff",
    light: "#e4fbff",
    lighta: "#edeef7",
  },
};
